  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Seney National
  Wildlife Refuge outlines Refuge accomplishments from February through April of 1939.
  The report begins by summarizing the weather conditions during this period. Wildlife-
  including migratory birds, upland game birds, furbearers, predators, rodents, and
  mammals- is also covered. Resource management is outlined; topics include fur harvesting.
  Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
